def entance(arr, low, high, target):
    if low >= high:
        return -1
    mid = (low + high) // 2
    if arr[mid] == target:
        return mid
    if arr[mid] > target:
        return entance(arr, low, mid - 1, target)
    else:
        return entance(arr, mid + 1, high, target)

